import cl from './Dialogs.module.css';
import {NavLink} from "react-router-dom";
import React from "react";
import {Routes} from "../../../navigations/routes";

const onActive = ({isActive}) => isActive ? `${cl.active}` : ''

export const Dialogs = () => {
    const dialogs = ['Vasyan', 'Goshan', 'Ivan', 'Snoop Dog'];

    return (
        <div className={cl.dialogs}>
            <div className={cl.dialogsItems}>
                <div><NavLink to={'/USER_1'} className={onActive}>{dialogs[0]}</NavLink></div>
                <div><NavLink to={'/USER_2'} className={onActive}>{dialogs[1]}</NavLink></div>
                <div><NavLink to={'/DIALOGS/USER_3'} className={onActive}>{dialogs[2]}</NavLink></div>
                <div><NavLink to={'/USER_4'} className={onActive}>{dialogs[3]}</NavLink></div>
            </div>


            <div className={cl.messages}>
                <div className={cl.message}>Hi</div>
                <div className={cl.message}>Bro</div>
                <div className={cl.message}>How are you?</div>
            </div>
        </div>
    )
}
